import Layout from "../components/MyLayout";

const Page = () => {
  const router = useRouter();

  const blogContent = prop => {
    <div>
      <h1>{prop.router.query.title}</h1>
      <p>This is the blog post content.</p>
    </div>;
  }
  return (
    <Layout content={blogContent}>

    </Layout>
  );
};

export default Page;
